Local variables in Pint are similar to local variables in other languages with a few restrictions. In Pint, variables must be initialized and are immutable . They basically hold values and help you write readable code, but are not meant to be modified. This is an important property that allows Pint to be fully declarative with no control flow . In Pint, the order in which you write your statements (variable declarations, constraints, etc.) is unimportant and has no impact on the behavior of the code. In order to declare a new variable, we use the let keyword: predicate foo() { let x = 5; let y: int = 6; constraint y - x == 1;
