A scalar type represents a single value. Pint has three primary scalar types: integers, Booleans, and 256-bit hashes. Integer Type An integer is a number without a fractional component. Pint has a single integer type called int which, when targeting the EssentialVM, represents a 64-bit signed integer . An int, therefore, can store numbers from −(2n−1) to 2n−1−1 inclusive, where n is the number of bits that represent the integer (64 in the case of EssentialVM). You can write integer literals in any of the forms shown in the table below. Note that number literals can use _ as a visual separator to make the number easier to read, such as 1_000, which will have the same value as if you had specified 1000. Number literals Examples Decimal 12_333 Hex 0x123f Binary 0b1111_1101 Numeric Operations Pint supports the basic mathematical operations you’d expect for integers: addition, subtraction, multiplication, division, and remainder. Integer division truncates toward zero to the nearest integer. The following code shows how you’d use each numeric operation in a let statement: // addition
let sum = 1 + 2 + 3; // subtraction
let difference = 15 - 1; // multiplication
