A select expression allows you to select between two alternatives based on a condition. The two alternatives must have the same type and that type determines the type of the whole select expression. For example: let y = (number < 5 ? 1 : 2); All select expressions start with a condition followed by the ? symbol. In this case, the condition checks whether or not the local variable number has a value less than 5. We place the expression that should be chosen if the condition is true immediately after the ? symbol. The symbol : is then added followed by the expression that should be chosen if the condition is false. Both options, 1 and 2, have the same type which is int and so, the type of y must also be int. If, for example, the types of the two expressions we're selecting from do not match, the compiler will emit a compile error. For example, if we try to compile the following code: predicate test(number: int) { let y = number < 5 ? 1 : true;
} we will get the following error: Error: branches of a select expression must have the same type ╭─[test.pnt:2:13] │ 2 │ let y = number < 5 ? 1 : true; │ ┬ ──┬─ │ ╰───────── 'then' branch has the type `int` │ │ │ ╰─── 'else' branch has the type `bool`
───╯ The condition of a select expression must be a bool. Otherwise, we will get a compile error. For example, if we try to compile the following code: predicate test(number: int) { let y = number ? 1 : 2;
} we will get the following error: Error: condition for select expression must be a `bool` ╭─[test.pnt:2:13] │ 2 │ let y = number ? 1 : 2; │ ───┬── │ ╰──── invalid type `int`, expecting `bool`
───╯ Note that Pint will not automatically try to convert non-Boolean types to a Boolean. You must be explicit and always provide a select expression with a Boolean as its condition.

