Storage variables are not useful unless we can read them and/or propose modifications to them . Recall that Pint is a declarative constraint-based language, and therefore, does not allow "writing" directly to a storage variable. Writing directly to storage is a concept you might be familiar with from other smart contract languages like Solidity , so you might be asking yourself the following question: "if I can't write directly to storage variables, how will their values ever change? How will the state of the blockchain ever change?" The answer to these questions lies at the core of what makes Pint and declarative blockchains actually declarative . Pint has no concept of "updating" state (or even predicate parameters or local variables for that matter). Pint simply expresses a desired outcome using constraint statements and relies on solutions to actually propose state changes. In order to express a desired outcome for a given storage variable, two things are needed: A way to read the current value of the variable. A way to express the future value of the variable. Reading a Storage Variable Reading a storage variable should not be an unfamiliar concept to you if you've worked with other smart contract languages before like Solidity . The syntax for reading a storage variable in Pint requires the storage keyword again: let a = storage::a;
let t = storage::t;
let t_1 = storage::t.1;
let arr_2_1: int = storage::arr[2].1; let x = storage::x;
let incremented = storage::x + 1; constraint incremented == x + 1; // always true! A few things to note here: Storage read expressions always start with storage:: followed by the name of the variable we're trying to read. The storage:: syntax means we're switching namespaces to that of the storage block. Each storage read expression is used in the initializer of a local variable. In fact, storage read expressions can only ever be used in initializers of local variables. Using a storage read expression in other contexts, such as in constraint storage::x == 5, is currently illegal. Fields or elements of a compound type in storage can be accessed individually, as in storage::t.1 and storage::arr[2].1. Arbitrary expressions that include storage read expressions can also be used to initialize local variables. Variable incremented is an example of that. Note that, while storage read expressions cannot be evaluated at compile time, they are actually known at solve-time: right before the solving process starts, every storage read expression is evaluated by directly inspecting the blockchain. The result is then used in the corresponding local variable initializer expression which becomes known in preparation for solving. Next State Recall that expressing a desired outcome for a given storage variable also requires a way to express the future value of the variable. In most imperative languages, statements like x = x + 1 are commonly used to mean " update the value of x to be equal to the current value of x plus 1". Because Pint is a constraint-based declarative language where the order of statements does not matter and there is no sequential execution, statements like x = x + 1 cannot be written and are not logical. Instead, Pint offers a special syntax, reserved for local variables, that means "the future value of". Here's an example: let bal = mut storage::bal;
constraint bal' >= bal + 42; Here, bal', unlike bal, is actually unknown at solve-time . That is, bal' must be solved for as if it were a predicate parameter and every solution must include a proposed value for bal'. If, for example, the value of bal was read to be 100 at solve-time, a solver might propose that the next value of bal should be 150 (i.e. bal' = 150) which would be a valid solution because 150 >= 100 + 42 (assuming all other constraints in the predicate are also satisfied). The ' operator can also be used for variables that have arbitrary initializers. For example: let bal_in_dollars = price * mut storage::bal;
constraint bal_in_dollars' == price * bal'; // always true! Basically, when validating a solution, bal_in_dollars' is computed by plugging in the new value of storage::bal into the expression price * storage::bal. That is, a valid solution must satisfy bal_in_dollars' == price * bal' where bal_in_dollars is computed in this way (this just happens to be always true in this case!). As you can imagine, using the ' operator for variables that do not depend on storage accesses is a no-op. For example let z = 42;
