constraint x >= 10;
constraint x < (10 * 10); It should hopefully be quite clear to you how this substitution happened. The compiler simply rewrote the body of the macro by replacing $v with x and $num with 10. The resulting code is then pasted exactly where the macro was called. Arbitrary Tokens as Macro Arguments The arguments to a macro call may be collections of tokens which do not necessarily parse to a proper expression, as in the previous example. For example, an operator like + or a type name such as int are valid!. If the token is an identifier, then it may be used as a name, such as the name of a decision variable or a new type. Here's an example: macro @do_decls($a, $a_expr, $b, $b_expr, $ty, $op) { let $a: $ty = $a_expr; let $b: $ty = $b_expr; constraint $b $op $a;
