constraint x2 > x1; Hopefully this gives you an idea of how powerful macros can be. Macro Expressions So far, we've only looked at example macros where the body is a list of declarations (such as let declarations or constraints). Macros are even more versatile than that! Macros can, in fact, produce an expression. This would be akin to functions that return values in other programming languages. The expression that you want produced by the macro must always be the last statement in the macro body. For example: macro @quotion($a, $b) { constraint $b > 0; // Declaration. $a / $b // Final expression.
