The second type of macros we will look at is "Variadic Macros". Variadic macros allow a special type of recursion via variadic parameters . Such special parameters allow macros to call themselves, essentially entering an expansion loop . Think of this as recursive code generation . The term "variadic" means that the macro accepts a variable number of parameters. In the parameter list of the macro definition this is indicated using a special parameter whose name starts with an &. Recursion may be performed via one or more recursing macros and at least one non-recursing, or terminating macros. The recursing macros call other versions of itself but with a different number of - usually fewer - arguments. The terminating macros do not call another version of itself. This is best explained with an example, so let's consider the following macro which implements a sum operation over an arbitrary number of named variables: // Recursive Macro
macro @sum($x, $y, &rest) { // Called only when `&rest` is not empty. // We recurse by adding `$x` and `$y` and using `&rest` as the second argument. @sum($x + $y; &rest)
} // Terminating Macro
macro @sum($x, $y) { // Called only when the number of arguments is exactly 2. $x + $y
} We have two versions of the @sum macro. Despite the apparent name clash, this is actually okay because the two macros accept a different number of parameters. The first version of @sum accepts $x, $y, and &rest while the second version accepts only $x and $y. The parameter &rest is special and is referred to as a "parameter pack". The parameter pack is never empty, therefore in order to call the first version of @sum, we must pass 3 or more arguments. Note : The parameter pack is not addressable in any way. It may only be used as an argument to another macro call. Now let's walk through how the compiler would expand a call to @sum. You will notice that the compiler will always try to match the number of arguments provided to the number of parameters in each macro, and the best match will be selected. Calling @sum(a; b) will expand directly using the terminating macro to the expression a + b. Calling @sum(a; b; c; d) will expand as follows: @sum(a; b; c; d) calls the recursive macro as @sum(a; b; [c, d]) where [c, d] is &rest. @sum(a; b; [c, d]) expands to @sum(a + b; c; d). @sum(a + b; c; d) calls the recursive macro again, as @sum(a + b; c; [d]). @sum(a + b; c; [d]) expands to @sum(a + b + c; d). @sum(a + b + c; d) calls the terminating macro. @sum(a + b + c; d) expands to a + b + c + d, which is the final expanded form of the macro call. Note that, since the &rest parameter pack is passed in its expanded form, the above @sum macros could instead be rewritten as follows, to the same effect: // Recursive Macro
macro @sum_v2($x, &rest) { @sum_v2($x + &rest)
} // Terminating Macro
macro @sum_v2($x) { $x
} Parameter packs can also be used by non-recursive macros which wish to call other recursive macros. A more interesting use of variadic macros might be to chain array accesses together in relative constraints: macro @chain($a, $index, &rest) { // Add the first link in the chain, then move to the rest. @chain_next($a; $index; &rest)
} macro @chain_next($a, $prev, $next, &rest) { // Add the next link: // constrain based on the previous link and continue. constraint $a[$next] > $a[$prev] + 10; @chain_next($a; $next; &rest)
} macro @chain_next($a, $prev, $last) { // Just expand to the final link. constraint $a[$last] > $a[$prev] + 10; $a[$last]
} When called as: predicate chain(array: int[4]) { let r = @chain(array; 0; 1; 2; 3);
